import React from "react";
import { Link } from "react-router-dom";

export const MoviesList = ({ movies }) => {
  console.log(movies);
  return (
      <ul>
      {movies.map((m) => (
          <li key={m.id}><Link to={`/movie/${m.id}`}>{m.title}</Link></li>
      ))}
      </ul>
  );
};
